var handleDataTableAutofill = function () {
        "use strict";
        0 !== $("#data-table-autofill").length && $("#data-table-autofill").DataTable({
            autoFill: !0,
            responsive: !0
        })
    },
    TableManageAutofill = function () {
        "use strict";
        return {
            init: function () {
                handleDataTableAutofill()
            }
        }
    }();
